import React, { Component } from 'react';
import Buscador from './components/Buscador';



class App extends Component{

    state = {
        termino:''
    }

    consultarApi = () => {

        const termino = this.state.termino;

        const url =`https://pixabay.com/api/videos/?key=24565416-af5f6e53807c085cc3685833b&q=${termino}`;

        //console.log(url);
        fetch()
    }

    datosbusqueda = (termino)=>{    
        // console.log(termino);
        this.setState({
            termino
        }, ()=> {
            this.consultarApi();
        })
    }
    
    render(){
        return(
            <div className="app container">
                <div className="jumbotron">
                    <p 
                    className="lead text-center">
                        Buscador de Imag√©nes</p>
                    <Buscador
                    datosBusqueda={this.datosBusqueda}
                    />
                </div>
                {this.state.termino}
            </div>
        );
    }
} 


export default App;
